package com.sajansthapit.authserver.authclient.models;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.Id;import jakarta.persistence.Table;import org.hibernate.annotations.CreationTimestamp;import org.hibernate.annotations.UpdateTimestamp;import java.time.Instant;@Entity@Table(name = "auth_client_redirect_uri")public class RedirectUri {    @Id    private String id;    @Column(name = "uri")    private String uri;    @CreationTimestamp    @Column(name = "created_at")    private Instant createdAt;    @UpdateTimestamp    @Column(name = "updated_at")    private Instant updatedAt;    public RedirectUri() {    }    public RedirectUri(String id, String uri, Instant createdAt, Instant updatedAt) {        this.id = id;        this.uri = uri;        this.createdAt = createdAt;        this.updatedAt = updatedAt;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getUri() {        return uri;    }    public void setUri(String uri) {        this.uri = uri;    }    public Instant getCreatedAt() {        return createdAt;    }    public void setCreatedAt(Instant createdAt) {        this.createdAt = createdAt;    }    public Instant getUpdatedAt() {        return updatedAt;    }    public void setUpdatedAt(Instant updatedAt) {        this.updatedAt = updatedAt;    }}